import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import StudentRegister from './components/Student/StudentRegister';
import StudentLogin from './components/Student/StudentLogin';
import StudentList from './components/Student/StudentList';
import StudentUpdate from './components/Student/StudentUpdate';
import FacultyRegister from './components/Faculty/FacultyRegister';
import FacultyLogin from './components/Faculty/FacultyLogin';
import FacultyList from './components/Faculty/FacultyList';
import FacultyUpdate from './components/Faculty/FacultyUpdate';
import FeedbackForm from './components/Feedback/FeedbackForm';
import CourseRegistration from './components/Course/CourseRegistration';
import CourseList from './components/Course/CourseList';
import CourseUpdate from './components/Course/CourseUpdate';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Project Management</h1>
        </header>
        <main>
          <Switch>
            <Route path="/student/register" component={StudentRegister} />
            <Route path="/student/login" component={StudentLogin} />
            <Route path="/students" component={StudentList} />
            <Route path="/student/update/:id" component={StudentUpdate} />
            <Route path="/faculty/register" component={FacultyRegister} />
            <Route path="/faculty/login" component={FacultyLogin} />
            <Route path="/faculties" component={FacultyList} />
            <Route path="/faculty/update/:id" component={FacultyUpdate} />
            <Route path="/feedback" component={FeedbackForm} />
            <Route path="/course/register" component={CourseRegistration} />
            <Route path="/courses" component={CourseList} />
            <Route path="/course/update/:id" component={CourseUpdate} />
          </Switch>
        </main>
      </div>
    </Router>
  );
}

export default App;
